-- ----------------------------
-- Table structure for shop_list
-- ----------------------------
CREATE TABLE `shop_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `item_id` int(11) NOT NULL COMMENT '物品id',
  `item_name` varchar(255) NOT NULL COMMENT '物品名称',
  `item_count` bigint(20) NOT NULL COMMENT '商品数量',
  `item_price` bigint(20) NOT NULL COMMENT '商品价格',
  `parent_id` int(11) DEFAULT NULL COMMENT '父类id',
  `race` int(11) DEFAULT NULL COMMENT '种族 0：天魔共同 -1：魔族 1：天族',
  `description` varchar(255) DEFAULT NULL COMMENT '物品描述',
  `add_time` datetime NOT NULL COMMENT '添加时间',
  `type` int(11) DEFAULT NULL COMMENT '0:顶级菜单 1：二级菜单 2：商品',
  `flag` int(11) NOT NULL DEFAULT '1' COMMENT '是否允许出售',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9187 DEFAULT CHARSET=utf8 COMMENT='商城物品表';

